tables.table_schema:
CREATE TABLE electric_vehicle_charging (
    vehicle_id INT PRIMARY KEY,
    charging_start TIMESTAMP,
    charging_end TIMESTAMP,
    charging_energy_kWh DECIMAL
);

CREATE TABLE grid_impact (
    grid_event_id INT PRIMARY KEY,
    event_timestamp TIMESTAMP,
    event_description TEXT,
    impact_level VARCHAR(50)
);

CREATE TABLE electric_vehicle (
   id UUID PRIMARY KEY,
   vehicle_id UUID NOT NULL,
   charging_status BOOLEAN NOT NULL,
   charging_power FLOAT NOT NULL
);

CREATE TABLE charging_station (
   id UUID PRIMARY KEY,
   station_id UUID NOT NULL, 
   location VARCHAR(255) NOT NULL
);

CREATE TABLE charging_history (
   id UUID PRIMARY KEY,
   vehicle_id UUID NOT NULL, 
   start_time TIMESTAMP NOT NULL, 
   end_time TIMESTAMP
);

CREATE TABLE charging_stations (
    station_id INT PRIMARY KEY,
    station_name VARCHAR(255),
    city VARCHAR(255),
    capacity INT
);

CREATE TABLE vehicles (
    vehicle_id INT PRIMARY KEY,
    vehicle_type VARCHAR(50),
    manufacturer VARCHAR(100),
    model VARCHAR(100)
);

CREATE TABLE grid_impact (
    impact_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    impact_description TEXT,
    affected_area VARCHAR(255)
);
